script: |
  super -f text -I q3293.spq | sort > q3293.out

inputs:
  - name: q3293.spq
    data: |
      SELECT col2 * + 34 * - col2 - + col1 * + + col2, - 96 AS col2 FROM tab0 (FORMAT parquet);
  - name: tab0

outputs:
  - name: q3293.out
    data: |
      -333333	-96
      -3610	-96
      -78913	-96
